import { useState } from "react";

const dark =
  "data:image/png;base64,";

const light =
  "data:image/png;base64,";

export const NsfwOverlay = ({ size }: { size?: "sm" | "md" }) => {
  const [hide, setHide] = useState(false);

  return hide ? null : (
    <div
      role="none"
      data-inner-clickable="true"
      className="bg-tint-50/80 backdrop-blur-xl absolute inset-0 grid place-content-center text-center shadow-inset select-none"
      onClick={(e) => [setHide(true), e.stopPropagation(), e.preventDefault()]}
    >
      <img
        src={light}
        alt="NSFW"
        className="dark:hidden object-contain max-w-64 max-h-64 size-full"
      />
      <img
        src={dark}
        alt="NSFW"
        className="hidden dark:block object-contain max-w-64 max-h-64 size-full"
      />
    </div>
  );
};
